Tim Penseleksi sebagaimana dimaksud ayat (2) ditetapkan oleh Walikota,
terdiri dari unsur:
a. Pemerintah Kota Bandung;
b. Dewan Pengawas;
c. Dihapus;
d. unsur lain yang dianggap perlu.

