BOPTN dipergunakan untuk: 
a. pelaksanaan penelitian dan pengabdian kepada masyarakat; 
b. biaya pemeliharaan pengadaan; 
c. penambahan bahan praktikum/kuliah; 
d. bahan pustaka; 
e. penjaminan mutu; 
f. pelaksanaan kegiatan kemahasiswaan; 
g. pembiayaan langganan daya dan jasa; 
h. pelaksanaan kegiatan penunjang; 
i. pengembangan teknologi informasi dan komunikasi (TIK) dalam 
pembelajaran; 
j. honor dosen dan tenaga kependidikan nonpegawai negeri sipil; 
k. pengadaan dosen tamu; 
l. pengadaan sarana dan prasarana sederhana; dan/atau 
m. kegiatan lain yang merupakan prioritas dalam renstra perguruan 
tinggi masing-masing.

Untuk melaksanakan tugas pokok dan kewajiban sebagaimana dimaksud 
pada ayat (2), Sekretariat Daerah mempunyai fungsi : 
a. penyusunan kebijakan pemerintahan daerah; 
b. pengkoordinasian pelaksanaan tugas perangkat daerah; 
c. pemantauan dan evaluasi pelaksanaan kebijakan pemerintah daerah; 
d. pembinaan administrasi dan aparatur pemerintahan daerah; dan 
e. pelaksanaan tugas lain yang diberikan oleh Walikota sesuai dengan 
tugas dan fungsinya.

